import './App.css';



class FoodPlan extends Component{

   render() {
    return (
      <div class ="Container">
        <div class ="Left-Side">
          <Avatar size={160} icon={<UserOutlined />} style={{ position:'absolute',backgroundColor: 'white',display: 'flex',alignItems: 'center',justifyContent: 'center',top:'5%'}} />
          <Card style={{ width: 300 }}>
              <p>Card content</p>
              <p>Card content</p>
              <p>Card content</p>
            </Card>,
        </div>
        <div class ="Right-Side">
          COOL
          COOL
          COOL
        </div>
      </div>

    );
  }
}
export default FoodPlan;
